@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard a owl:Class .
atm:Password a owl:Class .
atm:Account a owl:Class .
atm:BankComputer a owl:Class .
atm:ATM a owl:Class .
atm:Message a owl:Class .

atm:isValid a owl:ObjectProperty ;
    rdfs:domain [ a owl:Class ;
                  owl:unionOf (atm:CashCard atm:Password atm:Account) ] ;
    rdfs:range rdf:Literal .

atm:sendMessage a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Message .

atm:AccountOK a owl:NamedIndividual, atm:Message .

atm:BankComputer a owl:NamedIndividual .

[ a owl:Class ;
  rdfs:subClassOf atm:BankComputer ;
  owl:equivalentClass [ a owl:Restriction ;
                        owl:onProperty atm:sendMessage ;
                        owl:someValuesFrom atm:AccountOK ] ;
  owl:intersectionOf ( [ a owl:Restriction ;
                         owl:onProperty atm:isValid ;
                         owl:hasValue true ] ) ] .
